import { Button } from "./ui";
import { Mail, Phone, MapPin } from "lucide-react";

const Contact = () => {
  return (
    <div className="min-h-screen bg-secondary"> {/* Utilisation de la couleur secondaire pour le fond */}
      <main className="pt-20 px-4 sm:px-6 lg:px-8">
        <div className="max-w-7xl mx-auto">
          <h1 className="text-4xl font-bold text-primary mb-8">Contactez-nous</h1> {/* Titre avec couleur primaire */}

          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
            <div className="glass-card p-6 rounded-lg">
              <h2 className="text-2xl font-semibold text-primary mb-6">Nos coordonnées</h2> {/* Sous-titre avec couleur primaire */}

              <div className="space-y-4">
                <div className="flex items-center gap-3">
                  <span className="p-2 rounded-full bg-primary/20">
                    <Phone className="text-primary" size={24} /> {/* Icone avec couleur primaire */}
                  </span>
                  <div>
                    <p className="font-medium text-white">Téléphone</p> {/* Texte en blanc */}
                    <p className="text-gray-300">+33 1 23 45 67 89</p>
                  </div>
                </div>

                <div className="flex items-center gap-3">
                  <span className="p-2 rounded-full bg-primary/20">
                    <Mail className="text-primary" size={24} /> {/* Icone avec couleur primaire */}
                  </span>
                  <div>
                    <p className="font-medium text-white">Email</p> {/* Texte en blanc */}
                    <p className="text-gray-300">contact@autovente.fr</p>
                  </div>
                </div>

                <div className="flex items-center gap-3">
                  <span className="p-2 rounded-full bg-primary/20">
                    <MapPin className="text-primary" size={24} /> {/* Icone avec couleur primaire */}
                  </span>
                  <div>
                    <p className="font-medium text-white">Adresse</p> {/* Texte en blanc */}
                    <p className="text-gray-300">
                      123 Avenue des Champs-Élysées
                      <br />
                      75008 Paris, France
                    </p>
                  </div>
                </div>
              </div>
            </div>

            <div className="glass-card p-6 rounded-lg">
              <h2 className="text-2xl font-semibold text-primary mb-6">Envoyez-nous un message</h2> {/* Sous-titre avec couleur primaire */}

              <form className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-white mb-2">Nom</label> {/* Texte en blanc */}
                  <input
                    type="text"
                    className="w-full p-2 rounded-md bg-white/10 border border-white/20 focus:outline-none focus:ring-2 focus:ring-primary"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-white mb-2">Email</label> {/* Texte en blanc */}
                  <input
                    type="email"
                    className="w-full p-2 rounded-md bg-white/10 border border-white/20 focus:outline-none focus:ring-2 focus:ring-primary"
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-white mb-2">Message</label> {/* Texte en blanc */}
                  <textarea
                    rows={4}
                    className="w-full p-2 rounded-md bg-white/10 border border-white/20 focus:outline-none focus:ring-2 focus:ring-primary"
                  ></textarea>
                </div>

                <Button className="w-full bg-primary text-white hover:bg-primary/90">Envoyer</Button> {/* Bouton avec couleur primaire */}
              </form>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default Contact;
